import React, { Component, Fragment } from 'react';

class TimeSet extends Component {
  constructor() {
    super(props);
    this.state = {
      hour: 0,
      min: 0,
      sec: 0,
      miliSec:0
    }
  }
  render() {
    return (
      <Fragment>
        {this.props.hour} {this.props.min} {this.props.sec} {this.props.miliSec}
        <div className="input-row">
          <input type="text" value="" />
        </div>
      </Fragment>
    );
  }
}



export default TimeSet;
